import React from 'react';

const Habit = props => {

  const { id, habit, count } = props.habit;

  return (
    <li className="habit-li" key={id}>
      <span className="habit-content">{habit}</span>
      <span className="habit-count">count : {count}</span>
    </li>
  )
};

export default Habit;
